$(function(){
	var logo='data:image/png;base64,';
	$('#pdf-btn').click(function(){
		generarFichaInscripcion();
		
		
	});
	
	
	function generarFichaInscripcion(){
		var doc = new jsPDF();
		doc.setFontSize(9);
		doc.setFont('Calibri');
		doc.addImage(logo,'PNG',93,10,15,15);
		doc.text(93,30,"EET 3107");
		doc.text(85,33,"Juana Azurduy de Padilla");
		doc.setFontSize(12);
		doc.text(75,45,"Ficha de Inscripcin de Alumno");
		doc.text(25,65,"Alumno: "+$('#apellido').val()+' '+$('#nombre').val());
		doc.text(25,75,"DNI: "+$('#dni').val());
		doc.text(25,85,"Curso: "+$('#curso').val()+' Division: '+$('#division').val()+' Ciclo: '+$('#ciclo').val()+' Turno: '+$('#turno').val());
		doc.text(25,95,'Ao Lectivo: '+$('#anioLectivo').val()+'    Fecha De Inscripcin: '+dateFormatter($('#fechaInscripcion').val()));
		doc.text(25,165,"Firma del Alumno");
		doc.text(145,165,"Firma del Tutor/a");
		doc.save($('#dni').val()+'.pdf');
	}
	
	
	
	
	
	
	
	
	
	
	
	
	
	
	
	
	
	
	
	
	
	
	
	
	
	
	
	

});